import React from "react";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="px-6 py-12 text-center">
      <h1 className="text-5xl font-bold mb-4 tracking-tight">Fred Hyeonuk Nam</h1>
      <p className="text-lg text-gray-600 mb-8">Researcher · Musician · Guitar Luthier</p>
      <div className="grid grid-cols-2 sm:grid-cols-4 gap-4 max-w-lg mx-auto">
        <Link to="/about" className="bg-white/70 backdrop-blur-sm p-4 rounded-xl hover:shadow-md transition">About</Link>
        <Link to="/research" className="bg-white/70 backdrop-blur-sm p-4 rounded-xl hover:shadow-md transition">Research</Link>
        <Link to="/music" className="bg-white/70 backdrop-blur-sm p-4 rounded-xl hover:shadow-md transition">Music</Link>
        <Link to="/guitars" className="bg-white/70 backdrop-blur-sm p-4 rounded-xl hover:shadow-md transition">Guitars</Link>
      </div>
    </div>
  );
}
